<html>
  <head>
    <title>QuickUpdateEngineAPI</title>
  </head>
  <body>
    <?php
    $name = $_SERVER['HTTP_SHORTCUT_NAME'];
    $id = $_SERVER['HTTP_SHORTCUT_ID'];
    $currentversion = $_SERVER['HTTP_SHORTCUT_VERSION'];
    $service = $_SERVER['HTTP_SERVICE'];
    if (!(strpos($service, ':'))){
      $service = "RoutineHub";
    }
    if ($service == "RoutineHub"){
      $xml = file_get_contents('https://routinehub.co/api/v1/shortcuts/' . $id . '/versions/latest');
      $obj = json_decode($xml);
      $download = 'https://routinehub.co/download/' . $obj->id;
    } else {
      $xml = file_get_contents($service);
      $obj = json_decode($xml);
      $download = $obj->DownloadURL;
    }
    if ($obj->Version == $currentversion){
      $result = '{"result":"Updated","errors":"none"","UCFU":{"Shortcut Name":"' . $name . '","Current Version":"' . $currentversion. '","RoutineHub ID":"' . $id . '"}}';
      echo $result."<br>";
    } else {
      if ($obj->Version < $currentversion){
      $result = '{"result":"Rollback","errors":"none"","UCFU":{"Shortcut Name":"' . $name . '","Current Version":"' . $currentversion. '","RoutineHub ID":"' . $id . '"},"IsChangeAvailable":true,"DownloadURL":"' . $download . '","vCard":""}';
      echo $result."<br>";
      } else {
        $result = '{"result":"Update","errors":"none"","UCFU":{"Shortcut Name":"' . $name . '","Current Version":"' . $currentversion. '","RoutineHub ID":"' . $id . '"},"IsChangeAvailable":true,"DownloadURL":"' . download . '","vCard":""}';
        echo $result."<br>";
      }
    }
    
    ?> 
  </body>
</html>